        width: "100%" ,
        height:"100px" ,
        display:"flex" ,
        justifyContent : "center", 
        alignItems: "center",
        fontSize: "50px",
        // backgroundColor: props.value === "X" ? "#64CCC5":"#102C57" 
     }}
